<?php	require_once ("../lib/common/dao/VO.class.php");	class Configorg extends VO {		private $organizationVO;		private $configurationVO;		private $organizationid;		private $configurationid;		public function setOrganization($organizationVO){			$this->organizationVO=$organizationVO;		}		public function getOrganization(){			return $this->organizationVO;		}		public function setConfiguration($configurationVO){			$this->configurationVO=$configurationVO;		}		public function getConfiguration(){			return $this->configurationVO;		}		public function setOrganizationid($organizationid){			$this->organizationid=$organizationid;		}		public function getOrganizationid(){			return $this->organizationid;		}		public function setConfigurationid($configurationid){			$this->configurationid=$configurationid;		}		public function getConfigurationid(){			return $this->configurationid;		}		public function __toString(){			return "organizationid=".$this->organizationid."(".$this->organizationVO.")".", configurationid=".$this->configurationid."(".$this->configurationVO.")";		}	}?>